var game;
var gameLoaded = false;
var createOnLoaded = false;
var c = document.getElementById('c')
var v = document.getElementById('v')
var video = document.getElementById('video')
var num =0
window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 562,
        height: 1000,
        backgroundColor: 0x000000,
        parent:'c',
        transparent:true,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],
            addFlag = false;

        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        video.src = videoSrc.bro
        // c.style.visibility="hidden";
        video.play()

        this.letters = {
            dig: {
                letter_c: ['i', 'd', 'g' ],
                answer: 'dig',
                // prompt:[],
                box: 'box',
                plate: {
                    key: 'words',
                    x: 281,
                    y: 750,
                    width: 426,
                    height: 334
                },
                flag:false
            },
            pry: {
                letter_c: ['r', 'y', 'p', ],
                answer: 'pry',
                // prompt:[],
                box: 'box',
                plate: {
                    key: 'words',
                    x: 281,
                    y: 750,
                    width: 426,
                    height: 334
                },
                flag:false
            },
            buy: {
                letter_c: ['y', 'u', 'b' ],
                answer: 'buy',
                // prompt:[],
                box: 'box',
                plate: {
                    key: 'words',
                    x: 281,
                    y: 750,
                    width: 426,
                    height: 334
                },
                flag:false
            }

        }
        this.hand_arr = []
        this.hand()
        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    update(){
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        console.log(video.currentTime.toFixed(1))
        this.showHand()
        if(video.currentTime.toFixed(1) == 4.0 && num == 0){
            video.pause()
            setTimeout(() => {
                this.dig()
                setTimeout(() => {
                    this.hand.visible = 1
                }, 400);
            }, 500);
            num = 1
        }
        if( this.letters.dig.flag == true) {
            setTimeout(() => {
                video.play()
            }, 500);
            this.letters.dig.flag = false
        }

        if(video.currentTime.toFixed(1) == 9.1 && num == 1){
            video.pause()
            setTimeout(() => {
                this.pry()
            }, 500);
            num =2
        }

        if( this.letters.pry.flag == true) {
            setTimeout(() => {
                video.play()
            }, 500);
            this.letters.pry.flag = false
        }
        if(video.currentTime.toFixed(1) == 23.2 && num == 2 ){
            video.pause()
            setTimeout(() => {
                this.buy()
            }, 500);
            num =3
        }
    }

    dig(){
        this.clickWord('dig', this.letters)
    }
    pry(){
        this.clickWord('pry', this.letters)
    }
    buy(){
        var zzc = this.add.image(0, 0, 'words').setOrigin(0, 0).setDepth(5).setInteractive().setScale(5,5).setAlpha(0.001).once(
            'pointerdown',
            function (params) {
                this.showDownload()
            }, this
        )
        this.clickWord('buy', this.letters)
    }

    clickWord(levelName, jsonName) {
        var this_ = this
        var level, plate
        var letter_name = [],
            letter_name1 = []
        var letter_c1 = [],
            letter_c2 = []
        var result = []
        var boxName = []
        var showLetterName = []
        var hand,click,hand_falg
        var rect = new Phaser.Geom.Rectangle(-100, -100, game.config.width + 1000, game.config.height + 1000);
        var graphics1 = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics1.alpha = 0.5;
        graphics1.fillRectShape(rect);
        showPlate()
        //显示磁盘
        function showPlate() {
            for (var key in jsonName) {
                if (levelName == key) {
                    level = jsonName[key]
                    plate = this_.add.image(jsonName[key].plate.x, jsonName[key].plate.y, jsonName[key].plate.key).setScale(0, 0)
                    this_.tweens.add({
                        targets: [plate],
                        scaleX: 1.05,
                        scaleY: 1,
                        duration: 200,
                        onComplete: () => {
                            showLetter()
                        }
                    })
                }
            }
        }
        // 显示字母
        function showLetter() {
            if (!level.prompt) {
                level.prompt = []
            }
            for (let i = 0; i < level.prompt.length; i++) {
                result.push(level.prompt[i])
            }

            for (let i = 0; i < level.answer.length; i++) {
                boxName[i] = this_.add.image(level.plate.x + (i - (level.answer.length - 1) / 2) * 50, level.plate.y - 100, level.box).setScale(0.8, 0.8)
            }

            if (result.length > 0) {
                for (let i = 0; i < result.length; i++) {
                    showLetterName[i] = this_.add.image(boxName[i].x, boxName[i].y, result[i] + '1').setScale(0.8, 0.8).setInteractive()
                }
            }



            //找寻名字数组分割数组,排列按钮
            if (level.letter_c.length % 2 === 0) {
                letter_c1 = level.letter_c.slice(0, level.letter_c.length / 2)
                letter_c2 = level.letter_c.slice(level.letter_c.length / 2, level.letter_c.length)
                for (let i = 0; i < letter_c1.length; i++) {
                    letter_name1.push(this_.add.image(level.plate.x + (i - (letter_c1.length - 1) / 2) * 90, level.plate.y, letter_c1[i] + letter_c1[i]))
                    letter_name.push(this_.add.image(level.plate.x + (i - (letter_c1.length - 1) / 2) * 90, level.plate.y, letter_c1[i]).setInteractive())
                }
                for (let i = 0; i < letter_c2.length; i++) {
                    letter_name1.push(this_.add.image(level.plate.x + (i - (letter_c2.length - 1) / 2) * 90, level.plate.y + 90, letter_c2[i] + letter_c2[i]))
                    letter_name.push(this_.add.image(level.plate.x + (i - (letter_c2.length - 1) / 2) * 90, level.plate.y + 90, letter_c2[i]).setInteractive())
                }
            } else {
                if(level.letter_c.length == 3){
                    for (let i = 0; i < level.letter_c.length; i++) {
                        letter_name1.push(this_.add.image(level.plate.x + (i - (letter_c2.length - 1) / 2) * 90-135, level.plate.y+30, level.letter_c[i] + level.letter_c[i]))
                        letter_name.push(this_.add.image(level.plate.x + (i - (letter_c2.length - 1) / 2) * 90-135, level.plate.y +30, level.letter_c[i]).setInteractive())                       
                    }
                }else{
                    level.letter_c.push('a')
                    letter_c1 = level.letter_c.slice(0, level.letter_c.length / 2)
                    letter_c2 = level.letter_c.slice(level.letter_c.length / 2, level.letter_c.length)
                    for (let i = 0; i < letter_c1.length; i++) {
                        letter_name1.push(this_.add.image(level.plate.x + (i - (letter_c1.length - 1) / 2) * 90, level.plate.y, letter_c1[i] + letter_c1[i]))
                        letter_name.push(this_.add.image(level.plate.x + (i - (letter_c1.length - 1) / 2) * 90, level.plate.y, letter_c1[i]).setInteractive())
                    }
                    for (let i = 0; i < letter_c2.length; i++) {
                        letter_name1.push(this_.add.image(level.plate.x + (i - (letter_c2.length - 1) / 2) * 90, level.plate.y + 90, letter_c2[i] + letter_c2[i]))
                        letter_name.push(this_.add.image(level.plate.x + (i - (letter_c2.length - 1) / 2) * 90, level.plate.y + 90, letter_c2[i]).setInteractive())
                    }
                }

            }

            clickEvent()
            // Bomb()
        }
        //字母点击事件
        function clickEvent() {
            for (let i = 0; i < letter_name.length; i++) {
                letter_name[i].on('pointerdown', function () {
                    this.visible = 0
                    result.push(this.texture.key)
                    this_.hand_arr = result
                    showLetterName.push(this_.add.image(boxName[result.length - 1].x, boxName[result.length - 1].y, result[result.length - 1] + '1').setScale(0.8, 0.8).setInteractive())
                    back()
                    if (result.length == level.answer.length) {
                        if (result.join('') == level.answer) {
                            for (let i = 0; i < showLetterName.length; i++) {
                                showLetterName[i].setTint(0x00FF00)
                                var item = showLetterName[i]
                                this_.tweens.add({
                                    targets: [item],
                                    alpha: 0,
                                    delay: 50,
                                    duration: 50
                                })
                                this_.tweens.add({
                                    targets: [item],
                                    alpha: 1,
                                    delay: 100,
                                    duration: 50
                                })
                                this_.tweens.add({
                                    targets: [item],
                                    alpha: 0,
                                    delay: 150,
                                    duration: 50
                                })
                                this_.tweens.add({
                                    targets: [item],
                                    alpha: 1,
                                    delay: 200,
                                    duration: 50,
                                    onComplete: () => {
                                        if (item == showLetterName[showLetterName.length - 1]) {
                                            this_.tweens.add({
                                                targets: [plate],
                                                alpha: 0,
                                                scaleX: 0,
                                                scaleY: 0,
                                                duration: 200
                                            })
                                            for (let i = 0; i < letter_name.length; i++) {
                                                var item2 = letter_name[i]
                                                var item3 = letter_name1[i]
                                                this_.tweens.add({
                                                    targets: [item2, item3],
                                                    x: level.plate.x,
                                                    y: level.plate.y,
                                                    scaleX: 0,
                                                    scaleY: 0,
                                                    alpha: 0,
                                                    duration: 200
                                                })
                                            }
                                            for (let i = 0; i < boxName.length; i++) {
                                                var box = boxName[i]
                                                var showletter = showLetterName[i]
                                                this_.tweens.add({
                                                    targets: [box, showletter],
                                                    x: level.plate.x,
                                                    y: level.plate.y,
                                                    scaleX: 0,
                                                    scaleY: 0,
                                                    alpha: 0,
                                                    duration: 200,
                                                    onComplate: () => {
                                                        graphics1.destroy()
                                                        level.flag = true
                                                        
                                                    }
                                                })
                                            }
                                        }
                                    }
                                })
                            }
                            this_.hand.visible = 0
                        } else {
                            for (let i = 0; i < showLetterName.length; i++) {
                                showLetterName[i].setTint(0xed1941)
                                var item = showLetterName[i]
                                this_.tweens.add({
                                    targets: [item],
                                    alpha: 0,
                                    delay: 50,
                                    duration: 50
                                })
                                this_.tweens.add({
                                    targets: [item],
                                    alpha: 1,
                                    delay: 100,
                                    duration: 50
                                })
                                this_.tweens.add({
                                    targets: [item],
                                    alpha: 0,
                                    delay: 150,
                                    duration: 50
                                })
                                this_.tweens.add({
                                    targets: [item],
                                    alpha: 1,
                                    delay: 200,
                                    duration: 50,
                                    onComplete: () => {
                                        if (item == showLetterName[showLetterName.length - 1]) {
                                            for (let i = 0; i < letter_name.length; i++) {
                                                letter_name[i].visible = 1
                                            }
                                            for (let i = 0; i < showLetterName.length; i++) {
                                                showLetterName[i].destroy()
                                                if (i == showLetterName.length - 1) {
                                                    showLetterName = []
                                                    result = []
                                                    this_.hand_arr = result
                                                }
                                            }
                                            for (let i = 0; i < level.prompt.length; i++) {
                                                result.push(level.prompt[i])
                                            }
                                            if (result.length > 0) {
                                                for (let i = 0; i < result.length; i++) {
                                                    showLetterName[i] = this_.add.image(boxName[i].x, boxName[i].y, result[i] + '1').setScale(0.8, 0.8).setInteractive()
                                                }
                                            }
                                        }
                                    }
                                })
                            }
                        }
                    }
                    if(this.texture.key == 'b' && hand_falg == true){
                        hand.destroy()
                    }
                })
            }
        }
        //回退
        function back() {
            for (let i = 0; i < showLetterName.length; i++) {
                showLetterName[i].on('pointerdown', function () {
                    if (this == showLetterName[showLetterName.length - 1]) {
                        showLetterName[showLetterName.length - 1].destroy()
                        showLetterName.pop()
                        result.pop()
                        for (let i = 0; i < letter_name.length; i++) {
                            if(this.texture.key == letter_name[i].texture.key+'1'){
                                letter_name[i].visible = 1
                            }                            
                        }
                    }
                })

            }
        }
    }
    showDownload() {
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics1 = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics1.alpha = 0.2;
        graphics1.setDepth(8);
        graphics1.fillRectShape(rect);
        var win_bg = this.add.image(281, -400, 'nice').setDepth(10)
        var down = this.add.image(281, 620, 'continue').setDepth(10).setScale(0, 0).setInteractive().on('pointerdown', () => {
            landingPage()
        })
        this.tweens.add({
            targets: [win_bg],
            y: 500,
            duration: 800,
            ease: 'Back',
            onComplete: () => {
                this.tweens.add({
                    targets: [down],
                    scaleX: 1,
                    scaleY: 1,
                    duration: 500,
                    onComplete: () => {
                        
                        setInterval(() => {
                            this.tweens.add({
                                targets: [down],
                                scaleX: 1.1,
                                scaleY: 1.1,
                                duration: 300,
                                onComplete: () => {
                                    this.tweens.add({
                                        targets: [down],
                                        scaleX: 1,
                                        scaleY: 1,
                                        duration: 300,
                                        onComplete: () => {

                                        }
                                    })
                                }
                            })
                        }, 600);

                    }
                })
            }
        })
    }
    hand(){
        this.hand = this.add.image(-100,0,'hand').setDepth(10).setOrigin(0.3,0.1).setVisible(0).setAngle(-30)
        setInterval(() => {
            this.tweens.add({
                targets:[this.hand],
                scaleX:1,
                scaleY:1,
                duration:300,
                onComplete:()=>{
                    this.tweens.add({
                        targets:[this.hand],
                        scaleX:1.2,
                        scaleY:1.2,
                        duration:300,
                        onComplete:()=>{
                        }
                    })
                }
            })
        }, 600);
    }
    showHand(){
        var words_bg = {
            x:281,
            y:750
        }
        if(this.hand_arr.length == 0){
            this.hand.x = words_bg.x
            this.hand.y = words_bg.y+50
        }
        if(this.hand_arr[this.hand_arr.length-1] == 'p'){
            this.hand.x = words_bg.x-45
            this.hand.y = words_bg.y+110
        }
        if(this.hand_arr[this.hand_arr.length-1] == 'i'){
            this.hand.x = words_bg.x+45
            this.hand.y = words_bg.y+20
        }
        if(this.hand_arr[this.hand_arr.length-1] == 'c'){
            this.hand.x = words_bg.x+45
            this.hand.y = words_bg.y+110
        }

        
    }

    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
            v.style.width = windowWidth + "px";
            v.style.height = (windowWidth / gameRatio) + "px";
            c.style.width = windowWidth + "px";
            c.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
            v.style.width = (windowHeight * gameRatio) + "px";
            v.style.height = windowHeight + "px";
            c.style.width = (windowHeight * gameRatio) + "px";
            c.style.height = windowHeight + "px";
        }
    }
}
